import React from 'react';
import { View, Stylesheet, Text, Image } from 'react-native';

const ImageDetail = props => {
    console.log(props);
    return (
        <View>
        <Image source = {props.path} />
        <Text>Image Detail {props.title}</Text>
        <Text>Score is {props.score} </Text>
        </View>

    );

};

